import Numbers from './numbers/Numbers';

const array = [1, 2, 3, 4, 5];

const App = () => {
  console.log("object");
  return (
    <>
   <ul>
     {array.map((item, index, array) => 
     <Numbers item={item} index={index}/>)}
   </ul>
   <div>Hello App!</div>
   </>
  )
}



export default App;
